import './App.css';
import { BrowserRouter as Router, Link, Route , Routes  } from 'react-router-dom';

function App() {

  return (
    <Router>
      <div className='container'>
        <nav>
        <ul>
          <li>
            <Link to="/">List</Link>
          </li>
          <li>
            <Link to="/CreateMovie">Add New Movie</Link>
          </li>
        </ul>
        </nav>

      </div>
    </Router>

  );
}

export default App;
